(7, 'T-Mobile USA iPhone 5-15 Days ', 0, 110, '5-15 Days', '<p style=\"margin: 0px; padding: 5px; vertical-align: middle; clear: both; color: rgb(34, 91, 134); font-family: arial, sans-serif; font-size: 11.818181991577148px; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; vertical-align: middle; font-size: medium;\">Only clean Tmobile iPhone devices (no blacklisted Tmobile iPhones)</span></p>\n\n<p>&nbsp;</p>\n\n<p style=\"margin: 0px; padding: 5px; vertical-align: middle; clear: both; color: rgb(34, 91, 134); font-family: arial, sans-serif; font-size: 11.818181991577148px; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; vertical-align: middle; font-size: medium;\">To check if reported lost/stolen:&nbsp;<a href=\"http://www.t-mobile.com/verifyIMEI.aspx\" style=\"margin: 0px; padding: 0px; text-decoration: none; vertical-align: middle; color: rgb(17, 85, 204); cursor: pointer; font-size: 12.800000190734863px;\" target=\"_blank\">http://www.t-mobile.com/verifyIMEI.aspx</a></span></p>\n\n<p>&nbsp;</p>\n\n<p style=\"margin: 0px; padding: 5px; vertical-align: middle; clear: both; color: rgb(34, 91, 134); font-family: arial, sans-serif; font-size: 11.818181991577148px; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; vertical-align: middle; font-size: medium;\">It can still return not found if the device is reported for NON-EIP Payment. There is no checker for that.</span></p>\n\n<p>&nbsp;</p>\n\n<p style=\"margin: 0px; padding: 5px; vertical-align: middle; clear: both; color: rgb(34, 91, 134); font-family: arial, sans-serif; font-size: 11.818181991577148px; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px; vertical-align: middle;\"><span style=\"margin: 0px; padding: 0px; vertical-align: middle; font-size: medium;\">Models supported: 4, 4s, 5, 5s, 5c</span></strong></p>\n\n<p>&nbsp;</p>\n\n<p style=\"margin: 0px; padding: 5px; vertical-align: middle; clear: both; color: rgb(34, 91, 134); font-family: arial, sans-serif; font-size: 11.818181991577148px; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px; vertical-align: middle;\"><span style=\"margin: 0px; padding: 0px; vertical-align: middle; font-size: medium;\">Service is 5-15 business days.</span></strong></p>\n', 0, '2014-05-05', 1),
(8, 'Verizon iPhone Unlock 3-10 Days', 0, 65, '1-7 dAYS', '<p style="margin: 0px 0px 10px; line-height: 18px; color: rgb(58, 135, 173); font-family: Verdana, helvetica, arial, sans-serif; outline: none medium !important; background-color: rgb(217, 237, 247);">This service will unlock CLEAN Verizon iPhones only. Once unlocked will work with any carrier outside of USA for iPhone 4s. iPhone 5 and above normally work in USA.</p>\n\n<p>&nbsp;</p>\n\n<p style="margin: 0px 0px 10px; line-height: 18px; color: rgb(58, 135, 173); font-family: Verdana, helvetica, arial, sans-serif; outline: none medium !important; background-color: rgb(217, 237, 247);">Models supported: 4S/5/5C/5S</p>\n\n<p>&nbsp;</p>\n\n<p style="margin: 0px 0px 10px; line-height: 18px; color: rgb(58, 135, 173); font-family: Verdana, helvetica, arial, sans-serif; outline: none medium !important; background-color: rgb(217, 237, 247);">Turnaround is 1-7 days</p>\n', 0, '2014-09-22', 1),
