(41, 'AT', 1, 23, '1-7 Days', '<div class=\"sInfo\" style=\"color: rgb(58, 135, 173); font-family: Verdana, helvetica, arial, sans-serif; line-height: normal; outline: none medium !important;\">\n<div style=\"outline: none medium !important;\">\n<div class=\"info\" id=\"information\" style=\"padding: 10px 0px 10px 10px; outline: none medium !important;\">\n<p style=\"outline: none medium !important; margin: 0px 0px 10px; line-height: 18px;\">service works MONDAY THROUGH FRIDAY ONLY for processing so allow 1-7 WORKING DAYS for your order.</p>\n&nbsp;\n\n<p style=\"outline: none medium !important; margin: 0px 0px 10px; line-height: 18px;\">This service will unlock AT&amp;T iPhones that are :&nbsp;<strong style=\"outline: none medium !important;\">2G, 3G, 3GS</strong></p>\n&nbsp;\n\n<p style=\"outline: none medium !important; margin: 0px 0px 10px; line-height: 18px;\"><strong style=\"outline: none medium !important;\">DO NOT SUBMIT MODELS FOR: 4/4S/5/5C/5S. THEY WILL BE REJECTED.</strong></p>\n&nbsp;\n\n<p style=\"outline: none medium !important; margin: 0px 0px 10px; line-height: 18px;\">Orders that are completed are between 70-80%.</p>\n&nbsp;\n\n<p style=\"outline: none medium !important; margin: 0px 0px 10px; line-height: 18px;\">Reasons the devices can fail are due to: Phone is in contract, active on a line, reported lost/stolen or has an unpaid balance. Some of these orders may still go through if meet the criterias of in contract or active on a line.</p>\n</div>\n</div>\n</div>\n', 0, '2014-12-23', 1),
